import React, {useState} from 'react';
import Table from '../Partials/Table';
const Tables = () => {
	const [theme, setTheme] = useState('dark');
	return (
		<div>
			<Table
				tbodyData={[
					{id: '2', name: 'ali'},
					{id: '2', name: 'ali'},
					{id: '2', name: 'ali'},
					{id: '2', name: 'ali'},
				]}
				theme={theme}
			/>
		</div>
	);
};

export default Tables;
